import React from 'react'


// user = {
//     name: Rajat,
//     pic: "",
//     userType: "startup",
//     location: "Delhi",
//     AOI: []
// }
export default function User() {
    let user = {
            name: "Rajat",
            pic: "",
            userType: "startup",
            location: "Delhi",
            AOI: []
        }
    return (
        <div className="row">
            <div className="col-12 col-sm-6 col-md-3 Feed-user">
                <div className="Feed-user-image"></div>
                <div className="Feed-user-name">
                    <p>{user.name}</p>
                    <p>{user.location}</p>
                </div>
            </div>
        </div>
    )
}
